import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div className="container main">
      <h2 className="text-center primary" style={{color: "white"}}>Portfolio</h2>
      <div className="profile secondary col-4">
        <img className="rounded-circle profile-pic ml-4" alt="Picture of Aaron Jackson" src="img/profile.jpeg"/>
      </div>
    </div>
  );
}

export default App;
